import React, { useEffect, useState } from "react";
import Navbar from "./Components/Navbar";
import loadingPic from './'
import "./App.css";

function App() {
  const [load, setLoad] = useState(true);

  useEffect(() => {
    setTimeout(() => setLoad(true), 3000);
  }, []);

  return (
    <main className="flex flex-col justify-center align-middle">
      {
        load ? (
          <div className='flex flex-1  bg-transparent'>
            <img src={loadingPic} height={100} width={100} alt="logo pic" />
          </div>
        )
          :
          <Navbar />
      }
    </main>
  );
}

export default App;
